export default class ButtonComponent extends Component {
  render() {
    return (
      <div className="c-filter-btn">
        <ul>
          <li className="active">
            <a href="#">Toàn bộ kiến thức</a>
          </li>
          <li>
            <a href="#">Dự án nhiều bình chọn</a>
          </li>
        </ul>
      </div>
    );
  }
}
